pragma solidity =0.5.17;

import './interfaces/ISolarexSwapERC20.sol';
import './libraries/SafeMath.sol';
import './libraries/SignatureChecker.sol';

contract SolarexSwapERC20 is ISolarexSwapERC20 {
    using SafeMath for uint;

    string public name;
    string public symbol;
    uint8 public constant decimals = 18;

    uint public totalSupply;
    mapping(address => uint) public balanceOf;
    mapping(address => mapping(address => uint)) public allowance;

    bytes32 private DOMAIN_SEPARATOR;
    // keccak256("Permit(address owner,address spender,uint256 value,uint256 nonce,uint256 deadline)");
    bytes32 private constant PERMIT_TYPEHASH = 0x6e71edae12b1b97f4d1f60370fef10105fa2faae0126114a169c64845d6126c9;
    mapping(address => uint) public nonces;

    constructor() public {
        DOMAIN_SEPARATOR = keccak256(
            abi.encode(
                // keccak256('EIP712Domain(string name,string version,uint256 chainId,address verifyingContract)'),
                0x8b73c3c69bb8fe3d512ecc4cf759cc79239f7b179b0ffacaa9a75d522b39400f,

                // keccak256(bytes('SolaxToken LP')),
                0x0ca3a76575c83ea9a9d7a361c92f0f2e194c9d8dede9d62f88f2d3cb870b2814,

                // keccak256(bytes('1')),
                0xc89efdaa54c0f20c7adf612882df0950f5a951637e0307cdcb4c672f298b8bc6,

                324, // SolarexSwap - hardcode chain id
                address(this)
            )
        );
    }

    function _mint(address to, uint value) internal {
        totalSupply = totalSupply.add(value);
        balanceOf[to] = balanceOf[to].add(value);
        emit Transfer(address(0), to, value);
    }

    function _burn(address from, uint value) internal {
        balanceOf[from] = balanceOf[from].sub(value);
        totalSupply = totalSupply.sub(value);
        emit Transfer(from, address(0), value);
    }

    function _approve(address owner, address spender, uint value) private {
        allowance[owner][spender] = value;
        emit Approval(owner, spender, value);
    }

    function approve(address spender, uint value) external returns (bool) {
        _approve(msg.sender, spender, value);
        return true;
    }

    function transfer(address to, uint value) external returns (bool) {
        balanceOf[msg.sender] = balanceOf[msg.sender].sub(value);
        balanceOf[to] = balanceOf[to].add(value);
        emit Transfer(msg.sender, to, value);
        return true;
    }

    function transferFrom(address from, address to, uint value) external returns (bool) {
        if (from != msg.sender) {
            uint _allowance = allowance[from][msg.sender];
            if (_allowance != uint(-1)) {
                allowance[from][msg.sender] = _allowance.sub(value);
            }
        }
        balanceOf[from] = balanceOf[from].sub(value);
        balanceOf[to] = balanceOf[to].add(value);
        emit Transfer(from, to, value);
        return true;
    }

    function permit(address owner, address spender, uint value, uint deadline, uint8 v, bytes32 r, bytes32 s) external {
        require(deadline >= block.timestamp, 'X');
        bytes32 hash = keccak256(
            abi.encodePacked(
                '\x19\x01',
                DOMAIN_SEPARATOR,
                keccak256(abi.encode(PERMIT_TYPEHASH, owner, spender, value, nonces[owner]++, deadline))
            )
        );
        address recoveredAddress = ecrecover(hash, v, r, s);
        require(recoveredAddress != address(0) && recoveredAddress == owner, 'S');
        _approve(owner, spender, value);
    }

    function permit2(address owner, address spender, uint value, uint deadline, bytes calldata signature) external {
        require(deadline >= block.timestamp, 'X');
        bytes32 hash = keccak256(
            abi.encodePacked(
                '\x19\x01',
                DOMAIN_SEPARATOR,
                keccak256(abi.encode(PERMIT_TYPEHASH, owner, spender, value, nonces[owner]++, deadline))
            )
        );
        require(SignatureChecker.checkSignature(owner, hash, signature), 'S');
        _approve(owner, spender, value);
    }
}

contracts/SolarexSwapFactory.sol.content:
pragma solidity =0.5.17;

import './interfaces/ISolarexSwapFactory.sol';
import './SolarexSwapPair.sol';

contract SolarexSwapFactory is ISolarexSwapFactory {
    address public feeTo;
    address public feeToSetter;

    uint32 public defaultSwapFee = 3000; // 0.3%, in 1e6 precision
    uint8 public protocolFeeFactor = 5; // 1/5, 20%
    //bytes32 public constant INIT_CODE_PAIR_HASH = keccak256(abi.encodePacked(type(SolarexSwapPair).creationCode));

    mapping(address => mapping(address => address)) public getPair;
    address[] public allPairs;

    constructor(address _feeToSetter) public {
        feeToSetter = _feeToSetter;
    }

    function allPairsLength() external view returns (uint) {
        return allPairs.length;
    }

    function createPair(address tokenA, address tokenB) external returns (address pair) {
        require(tokenA != tokenB, 'D');

        (address token0, address token1) = tokenA < tokenB ? (tokenA, tokenB) : (tokenB, tokenA);
        require(token0 != address(0), 'Z');
        require(getPair[token0][token1] == address(0), 'R'); // single check is sufficient

        bytes memory bytecode = type(SolarexSwapPair).creationCode;
        bytes32 salt = keccak256(abi.encodePacked(token0, token1));
        assembly {
            pair := create2(0, add(bytecode, 32), mload(bytecode), salt)
        }
        ISolarexSwapPair(pair).initialize(token0, token1);

        getPair[token0][token1] = pair;
        getPair[token1][token0] = pair; // populate mapping in the reverse direction
        allPairs.push(pair);
        emit PairCreated(token0, token1, pair, allPairs.length);
    }

    function setFeeTo(address _feeTo) external {
        require(msg.sender == feeToSetter, 'F');
        feeTo = _feeTo;
    }

    function setFeeToSetter(address _feeToSetter) external {
        require(msg.sender == feeToSetter, 'F');
        feeToSetter = _feeToSetter;
    }

    function setProtocolFeeFactor(uint8 _protocolFeeFactor) external {
        require(_protocolFeeFactor > 1, 'V');
        protocolFeeFactor = _protocolFeeFactor;
    }

    function setDefaultSwapFee(uint32 _defaultSwapFee) external {
        require(_defaultSwapFee <= 1e5, 'V'); // maximum 10%
        defaultSwapFee = _defaultSwapFee;
    }

    function setPairSwapFee(address _pair, uint32 _pairSwapFee) external {
        require(_pairSwapFee <= 1e5 || _pairSwapFee == uint32(-1), 'V'); // maximum 10%
        ISolarexSwapPair(_pair).setPairSwapFee(_pairSwapFee);
    }
}

contracts/SolarexSwapPair.sol.content:
pragma solidity =0.5.17;

import './interfaces/ISolarexSwapPair.sol';
import './SolarexSwapERC20.sol';
import './libraries/Math.sol';
import './libraries/UQ112x112.sol';
import './interfaces/IERC20.sol';
import './interfaces/ISolarexSwapFactory.sol';
import './interfaces/IUniswapV2Callee.sol';

contract SolarexSwapPair is ISolarexSwapPair, SolarexSwapERC20 {
    using SafeMath  for uint;
    using UQ112x112 for uint224;

    uint private constant MINIMUM_LIQUIDITY = 1000;
    bytes4 private constant SELECTOR = 0xa9059cbb; //bytes4(keccak256(bytes('transfer(address,uint256)')));

    address public factory;
    address public token0;
    address public token1;

    uint112 private reserve0;           // uses single storage slot, accessible via getReserves
    uint112 private reserve1;           // uses single storage slot, accessible via getReserves
    uint32  private blockTimestampLast; // uses single storage slot, accessible via getReserves

    uint public price0CumulativeLast;
    uint public price1CumulativeLast;
    uint public kLast; // reserve0 * reserve1, as of immediately after the most recent liquidity event

    uint32 public pairSwapFee = uint32(-1); // use defaultSwapFee from factory

    uint8 private unlocked = 1;
    modifier lock() {
        require(unlocked == 1);
        unlocked = 0;
        _;
        unlocked = 1;
    }

    function getReserves() external view returns (uint112 _reserve0, uint112 _reserve1, uint32 _blockTimestampLast) {
        _reserve0 = reserve0;
        _reserve1 = reserve1;
        _blockTimestampLast = blockTimestampLast;
    }

    function getReservesSimple() external view returns (uint112 _reserve0, uint112 _reserve1) {
        _reserve0 = reserve0;
        _reserve1 = reserve1;
    }

    function _safeTransfer(address token, address to, uint value) private {
        (bool success, bytes memory data) = token.call(abi.encodeWithSelector(SELECTOR, to, value));
        require(success && (data.length == 0 || abi.decode(data, (bool))), 'T');
    }

    constructor() public {
        factory = msg.sender;
    }

    function _getSymbol(address token) private view returns (bool, string memory) {
        // bytes4(keccak256(bytes("symbol()")))
        (bool success, bytes memory returndata) = token.staticcall(abi.encodeWithSelector(0x95d89b41));
        if (success) {
            return (true, abi.decode(returndata, (string)));
        } else {
            return (false, "");
        }
    }

    // called once by the factory at time of deployment
    function initialize(address _token0, address _token1) external {
        require(msg.sender == factory); // sufficient check
        token0 = _token0;
        token1 = _token1;

        // try to set symbols for the pair token
        (bool success0, string memory symbol0) = _getSymbol(_token0);
        (bool success1, string memory symbol1) = _getSymbol(_token1);
        if (success0 && success1) {
            bytes memory _symbol = abi.encodePacked(symbol0, "/", symbol1, " SLP");
            name = string(abi.encodePacked("SolarexSwap ", _symbol));
            symbol = string(_symbol);
        } else {
            name = "SolaxToken LP";
            symbol = "SLP";
        }
    }

    // called by the factory to set the swapFee
    function setPairSwapFee(uint32 _pairSwapFee) external {
        require(msg.sender == factory); // sufficient check
        pairSwapFee = _pairSwapFee;
    }

    function getSwapFee() public view returns (uint32 swapFee) {
        uint32 _pairSwapFee = pairSwapFee; // gas savings
        swapFee = _pairSwapFee == uint32(-1) ? ISolarexSwapFactory(factory).defaultSwapFee() : _pairSwapFee;
    }

    // update reserves and, on the first call per block, price accumulators
    function _update(uint balance0, uint balance1, uint112 _reserve0, uint112 _reserve1) private {
        require(balance0 <= uint112(-1) && balance1 <= uint112(-1));

        uint32 blockTimestamp = uint32(block.timestamp);
        uint32 timeElapsed = blockTimestamp - blockTimestampLast; // overflow is desired
        if (timeElapsed != 0 && _reserve0 != 0 && _reserve1 != 0) {
            // * never overflows, and + overflow is desired
            price0CumulativeLast += uint(UQ112x112.encode(_reserve1).uqdiv(_reserve0)) * timeElapsed;
            price1CumulativeLast += uint(UQ112x112.encode(_reserve0).uqdiv(_reserve1)) * timeElapsed;
        }

        reserve0 = uint112(balance0);
        reserve1 = uint112(balance1);
        blockTimestampLast = blockTimestamp;
        emit Sync(reserve0, reserve1);
    }

    // if fee is on, mint liquidity equivalent to 1/(protocolFeeFactor) of the growth in sqrt(k)
    function _mintFee(uint112 _reserve0, uint112 _reserve1) private returns (bool feeOn) {
        address _factory = factory; // gas savings
        address feeTo = ISolarexSwapFactory(_factory).feeTo();
        feeOn = feeTo != address(0);
        uint _kLast = kLast; // gas savings
        if (feeOn) {
            if (_kLast != 0) {
                uint rootK = Math.sqrt(uint(_reserve0).mul(_reserve1));
                uint rootKLast = Math.sqrt(_kLast);
                if (rootK > rootKLast) {
                    uint8 protocolFeeFactor = ISolarexSwapFactory(_factory).protocolFeeFactor();
                    uint numerator = totalSupply.mul(rootK.sub(rootKLast));
                    uint denominator = rootK.mul(protocolFeeFactor - 1).add(rootKLast);
                    uint liquidity = numerator / denominator;
                    if (liquidity != 0) {
                        _mint(feeTo, liquidity);
                    }
                }
            }
        } else if (_kLast != 0) {
            kLast = 0;
        }
    }

    // this low-level function should be called from a contract which performs important safety checks
    function mint(address to) external lock returns (uint liquidity) {
        (uint112 _reserve0, uint112 _reserve1) = (reserve0, reserve1); // gas savings
        uint balance0 = IERC20(token0).balanceOf(address(this));
        uint balance1 = IERC20(token1).balanceOf(address(this));
        uint amount0 = balance0.sub(_reserve0);
        uint amount1 = balance1.sub(_reserve1);

        bool feeOn = _mintFee(_reserve0, _reserve1);
        uint _totalSupply = totalSupply; // gas savings, must be defined here since totalSupply can update in _mintFee
        if (_totalSupply == 0) {
            liquidity = Math.sqrt(amount0.mul(amount1)).sub(MINIMUM_LIQUIDITY);
           _mint(address(0), MINIMUM_LIQUIDITY); // permanently lock the first MINIMUM_LIQUIDITY tokens
        } else {
            liquidity = Math.min(amount0.mul(_totalSupply) / _reserve0, amount1.mul(_totalSupply) / _reserve1);
        }
        require(liquidity != 0, 'M');
        _mint(to, liquidity);

        _update(balance0, balance1, _reserve0, _reserve1);
        if (feeOn) {
            kLast = uint(reserve0).mul(reserve1); // reserve0 and reserve1 are up-to-date
        }
        emit Mint(msg.sender, amount0, amount1);
    }

    // this low-level function should be called from a contract which performs important safety checks
    function burn(address to) external lock returns (uint amount0, uint amount1) {
        (uint112 _reserve0, uint112 _reserve1) = (reserve0, reserve1); // gas savings
        address _token0 = token0;                                // gas savings
        address _token1 = token1;                                // gas savings
        uint balance0 = IERC20(_token0).balanceOf(address(this));
        uint balance1 = IERC20(_token1).balanceOf(address(this));
        uint liquidity = balanceOf[address(this)];

        bool feeOn = _mintFee(_reserve0, _reserve1);
        uint _totalSupply = totalSupply; // gas savings, must be defined here since totalSupply can update in _mintFee
        amount0 = liquidity.mul(balance0) / _totalSupply; // using balances ensures pro-rata distribution
        amount1 = liquidity.mul(balance1) / _totalSupply; // using balances ensures pro-rata distribution
        require(amount0 != 0 && amount1 != 0, 'U');

        _burn(address(this), liquidity);
        _safeTransfer(_token0, to, amount0);
        _safeTransfer(_token1, to, amount1);
        balance0 = IERC20(_token0).balanceOf(address(this));
        balance1 = IERC20(_token1).balanceOf(address(this));

        _update(balance0, balance1, _reserve0, _reserve1);
        if (feeOn) {
            kLast = uint(reserve0).mul(reserve1); // reserve0 and reserve1 are up-to-date
        }
        emit Burn(msg.sender, amount0, amount1, to);
    }

    // this low-level function should be called from a contract which performs important safety checks
    function swap(uint amount0Out, uint amount1Out, address to, bytes calldata data) external lock {
        require(amount0Out != 0 || amount1Out != 0, 'O');
        (uint112 _reserve0, uint112 _reserve1) = (reserve0, reserve1); // gas savings
        require(amount0Out < _reserve0 && amount1Out < _reserve1, 'L');

        uint balance0;
        uint balance1;
        { // scope for _token{0,1}, avoids stack too deep errors
        address _token0 = token0;
        address _token1 = token1;
        //require(to != _token0 && to != _token1, 'UniswapV2: INVALID_TO');

        if (amount0Out != 0) {
            _safeTransfer(_token0, to, amount0Out); // optimistically transfer tokens
        }
        if (amount1Out != 0) {
            _safeTransfer(_token1, to, amount1Out); // optimistically transfer tokens
        }
        if (data.length != 0) {
            IUniswapV2Callee(to).uniswapV2Call(msg.sender, amount0Out, amount1Out, data);
        }
        balance0 = IERC20(_token0).balanceOf(address(this));
        balance1 = IERC20(_token1).balanceOf(address(this));
        }

        uint amount0In = balance0 > _reserve0 - amount0Out ? balance0 - (_reserve0 - amount0Out) : 0;
        uint amount1In = balance1 > _reserve1 - amount1Out ? balance1 - (_reserve1 - amount1Out) : 0;
        require(amount0In != 0 || amount1In != 0, 'I');

        { // scope for reserve{0,1}Adjusted, avoids stack too deep errors
        uint32 _swapFee = getSwapFee();
        uint balance0Adjusted = balance0.mul(1e6).sub(amount0In.mul(_swapFee));
        uint balance1Adjusted = balance1.mul(1e6).sub(amount1In.mul(_swapFee));
        require(balance0Adjusted.mul(balance1Adjusted) >= uint(_reserve0).mul(_reserve1).mul(1e12), 'K');
        }

        _update(balance0, balance1, _reserve0, _reserve1);
        emit Swap(msg.sender, amount0In, amount1In, amount0Out, amount1Out, to);
    }

    // this low-level function should be called from a contract which performs important safety checks
    function swapFor0(uint amount0Out, address to) external lock {
        require(amount0Out != 0, 'O');
        (uint112 _reserve0, uint112 _reserve1) = (reserve0, reserve1); // gas savings
        require(amount0Out < _reserve0, 'L');

        address _token0 = token0;
        _safeTransfer(_token0, to, amount0Out); // optimistically transfer tokens
        uint balance0 = IERC20(_token0).balanceOf(address(this));
        uint balance1 = IERC20(token1).balanceOf(address(this));

        uint amount1In = balance1 > _reserve1 ? balance1 - _reserve1 : 0;
        require(amount1In != 0, 'I');

        { // scope for reserve{0,1}Adjusted, avoids stack too deep errors
        uint balance1Adjusted = balance1.mul(1e6).sub(amount1In.mul(getSwapFee()));
        require(balance0.mul(balance1Adjusted) >= uint(_reserve0).mul(_reserve1).mul(1e6), 'K');
        }

        _update(balance0, balance1, _reserve0, _reserve1);
        emit Swap(msg.sender, 0, amount1In, amount0Out, 0, to);
    }

    // this low-level function should be called from a contract which performs important safety checks
    function swapFor1(uint amount1Out, address to) external lock {
        require(amount1Out != 0, 'O');
        (uint112 _reserve0, uint112 _reserve1) = (reserve0, reserve1); // gas savings
        require(amount1Out < _reserve1, 'L');

        address _token1 = token1;
        _safeTransfer(_token1, to, amount1Out); // optimistically transfer tokens
        uint balance0 = IERC20(token0).balanceOf(address(this));
        uint balance1 = IERC20(_token1).balanceOf(address(this));

        uint amount0In = balance0 > _reserve0 ? balance0 - _reserve0 : 0;
        require(amount0In != 0, 'I');

        { // scope for reserve{0,1}Adjusted, avoids stack too deep errors
        uint balance0Adjusted = balance0.mul(1e6).sub(amount0In.mul(getSwapFee()));
        require(balance0Adjusted.mul(balance1) >= uint(_reserve0).mul(_reserve1).mul(1e6), 'K');
        }

        _update(balance0, balance1, _reserve0, _reserve1);
        emit Swap(msg.sender, amount0In, 0, 0, amount1Out, to);
    }

    // force balances to match reserves
    function skim(address to) external lock {
        address _token0 = token0; // gas savings
        address _token1 = token1; // gas savings
        _safeTransfer(_token0, to, IERC20(_token0).balanceOf(address(this)).sub(reserve0));
        _safeTransfer(_token1, to, IERC20(_token1).balanceOf(address(this)).sub(reserve1));
    }

    // force reserves to match balances
    function sync() external lock {
        _update(IERC20(token0).balanceOf(address(this)), IERC20(token1).balanceOf(address(this)), reserve0, reserve1);
    }
}

contracts/SolarexSwapRouter.sol.content:
pragma solidity =0.5.17;

import './interfaces/ISolarexSwapFactory.sol';
import './libraries/TransferHelper.sol';
import './interfaces/ISolarexSwapRouter.sol';
import './libraries/SolarexSwapLibrary.sol';
import './libraries/SafeMath.sol';
import './interfaces/IERC20.sol';
import './interfaces/IWETH.sol';
import './interfaces/IProxyTarget.sol';

contract SolarexSwapRouter is ISolarexSwapRouter {
    using SafeMath for uint;

    address public factory;
    address public WETH;
    address public owner;

    modifier ensure(uint deadline) {
        require(deadline >= block.timestamp, 'X');
        _;
    }

    constructor(address _factory, address _WETH) public {
        factory = _factory;
        WETH = _WETH;
        owner = msg.sender;
    }

    function() external payable {
        assert(msg.sender == WETH); // only accept ETH via fallback from the WETH contract
    }

    function _getReservesWithPair(address pair, address tokenA, address tokenB) internal view returns (uint reserveA, uint reserveB) {
        (uint reserve0, uint reserve1) = ISolarexSwapPair(pair).getReservesSimple();
        (reserveA, reserveB) = tokenA < tokenB ? (reserve0, reserve1) : (reserve1, reserve0);
    }

    function _quote(uint amountA, uint reserveA, uint reserveB) internal pure returns (uint amountB) {
        amountB = amountA.mul(reserveB) / reserveA;
    }

    // **** RESCUE ****
    function rescueERC20(address token, uint value, address to) external {
        require(msg.sender == owner);
        require(to != address(0));
        TransferHelper.safeTransfer(token, to, value);
    }

    function rescueETH(uint value, address to) external {
        require(msg.sender == owner);
        require(to != address(0));
        TransferHelper.safeTransferETH(to, value);
    }

    // **** PROXY ****
    function stakeProxy(
        address target,
        address token,
        uint256 amount,
        address onBehalf,
        uint deadline
    ) external ensure(deadline) {
        TransferHelper.safeTransferFrom(token, msg.sender, address(this), amount);
        TransferHelper.safeApprove(token, target, amount);
        IProxyTarget(target).stake(amount, onBehalf);
    }

    function depositProxy(
        address target,
        address token,
        uint256 amount,
        address to,
        uint deadline
    ) external ensure(deadline) {
        TransferHelper.safeTransferFrom(token, msg.sender, address(this), amount);
        TransferHelper.safeApprove(token, target, amount);
        IProxyTarget(target).deposit(token, amount, to);
    }

    function swapProxy(
        address target,
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        address to,
        uint deadline
    ) external ensure(deadline) {
        TransferHelper.safeTransferFrom(tokenIn, msg.sender, address(this), amountIn);
        TransferHelper.safeApprove(tokenIn, target, amountIn);
        IProxyTarget(target).swap(tokenIn, tokenOut, amountIn, to);
    }

    // **** ADD LIQUIDITY ****
    function _addLiquidity(
        address _factory,
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin
    ) internal returns (address pair, uint amountA, uint amountB) {
        pair = ISolarexSwapFactory(_factory).getPair(tokenA, tokenB);
        // create the pair if it doesn't exist yet
        if (pair == address(0)) {
            pair = ISolarexSwapFactory(_factory).createPair(tokenA, tokenB);
            (amountA, amountB) = (amountADesired, amountBDesired);
        } else {
            (uint reserveA, uint reserveB) = _getReservesWithPair(pair, tokenA, tokenB);
            if (reserveA == 0 && reserveB == 0) {
                (amountA, amountB) = (amountADesired, amountBDesired);
            } else {
                uint amountBOptimal = _quote(amountADesired, reserveA, reserveB);

                if (amountBOptimal <= amountBDesired) {
                    require(amountBOptimal >= amountBMin, 'B');
                    (amountA, amountB) = (amountADesired, amountBOptimal);
                } else {
                    uint amountAOptimal = _quote(amountBDesired, reserveB, reserveA);
                    //assert(amountAOptimal <= amountADesired);
                    require(amountAOptimal >= amountAMin, 'A');
                    (amountA, amountB) = (amountAOptimal, amountBDesired);
                }
            }
        }
    }

    function addLiquidity(
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external ensure(deadline) returns (uint amountA, uint amountB, uint liquidity) {
        address pair;
        (pair, amountA, amountB) = _addLiquidity(factory, tokenA, tokenB, amountADesired, amountBDesired, amountAMin, amountBMin);

        TransferHelper.safeTransferFrom(tokenA, msg.sender, pair, amountA);
        TransferHelper.safeTransferFrom(tokenB, msg.sender, pair, amountB);

        liquidity = ISolarexSwapPair(pair).mint(to);
    }

    function addLiquidityETH(
        address token,
        uint amountTokenDesired,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external payable ensure(deadline) returns (uint amountToken, uint amountETH, uint liquidity) {
        address _WETH = WETH;
        address pair;
        (pair, amountToken, amountETH) = _addLiquidity(
            factory,
            token,
            _WETH,
            amountTokenDesired,
            msg.value,
            amountTokenMin,
            amountETHMin
        );

        TransferHelper.safeTransferFrom(token, msg.sender, pair, amountToken);

        IWETH(_WETH).deposit.value(amountETH)();
        assert(IWETH(_WETH).transfer(pair, amountETH));

        liquidity = ISolarexSwapPair(pair).mint(to);

        // refund dust eth, if any
        if (msg.value > amountETH) {
            TransferHelper.safeTransferETH(msg.sender, msg.value - amountETH);
        }
    }

    // **** REMOVE LIQUIDITY ****
    function _removeLiquidity(
        address pair,
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to
    ) internal returns (uint amountA, uint amountB) {
        ISolarexSwapPair(pair).transferFrom(msg.sender, pair, liquidity); // send liquidity to pair
        (uint amount0, uint amount1) = ISolarexSwapPair(pair).burn(to);

        (amountA, amountB) = tokenA < tokenB ? (amount0, amount1) : (amount1, amount0);
        require(amountA >= amountAMin, 'A');
        require(amountB >= amountBMin, 'B');
    }

    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external ensure(deadline) returns (uint amountA, uint amountB) {
        address pair = SolarexSwapLibrary.pairFor(factory, tokenA, tokenB);
        (amountA, amountB) = _removeLiquidity(pair, tokenA, tokenB, liquidity, amountAMin, amountBMin, to);
    }

    function _removeLiquidityETH(
        address _WETH,
        address pair,
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to
    ) internal returns (uint amountToken, uint amountETH) {
        (amountToken, amountETH) = _removeLiquidity(
            pair,
            token,
            _WETH,
            liquidity,
            amountTokenMin,
            amountETHMin,
            address(this)
        );

        TransferHelper.safeTransfer(token, to, amountToken);

        IWETH(_WETH).withdraw(amountETH);
        TransferHelper.safeTransferETH(to, amountETH);
    }

    function removeLiquidityETH(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external ensure(deadline) returns (uint amountToken, uint amountETH) {
        address _WETH = WETH;
        address pair = SolarexSwapLibrary.pairFor(factory, token, _WETH);
        (amountToken, amountETH) = _removeLiquidityETH(_WETH, pair, token, liquidity, amountTokenMin, amountETHMin, to);
    }

    function removeLiquidityWithPermit2(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline,
        bool approveMax, bytes calldata signature
    ) external returns (uint amountA, uint amountB) {
        address pair = SolarexSwapLibrary.pairFor(factory, tokenA, tokenB);

        { // scope to avoid stack too deep errors
        uint value = approveMax ? uint(-1) : liquidity;
        ISolarexSwapPair(pair).permit2(msg.sender, address(this), value, deadline, signature);
        }

        (amountA, amountB) = _removeLiquidity(pair, tokenA, tokenB, liquidity, amountAMin, amountBMin, to);
    }

    function removeLiquidityETHWithPermit2(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline,
        bool approveMax, bytes calldata signature
    ) external returns (uint amountToken, uint amountETH) {
        address pair = SolarexSwapLibrary.pairFor(factory, token, WETH);

        { // scope to avoid stack too deep errors
        uint value = approveMax ? uint(-1) : liquidity;
        ISolarexSwapPair(pair).permit2(msg.sender, address(this), value, deadline, signature);
        }

        (amountToken, amountETH) = _removeLiquidityETH(WETH, pair, token, liquidity, amountTokenMin, amountETHMin, to);
    }

    // **** REMOVE LIQUIDITY (supporting fee-on-transfer tokens) ****
    function _removeLiquidityETHSupportingFeeOnTransferTokens(
        address _WETH,
        address pair,
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to
    ) internal returns (uint amountETH) {
        (, amountETH) = _removeLiquidity(
            pair,
            token,
            _WETH,
            liquidity,
            amountTokenMin,
            amountETHMin,
            address(this)
        );

        TransferHelper.safeTransfer(token, to, IERC20(token).balanceOf(address(this)));

        IWETH(_WETH).withdraw(amountETH);
        TransferHelper.safeTransferETH(to, amountETH);
    }

    function removeLiquidityETHSupportingFeeOnTransferTokens(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external ensure(deadline) returns (uint amountETH) {
        address _WETH = WETH;
        address pair = SolarexSwapLibrary.pairFor(factory, token, _WETH);
        amountETH = _removeLiquidityETHSupportingFeeOnTransferTokens(_WETH, pair, token, liquidity, amountTokenMin, amountETHMin, to);
    }

    function removeLiquidityETHWithPermitSupportingFeeOnTransferTokens(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline,
        bool approveMax, uint8 v, bytes32 r, bytes32 s
    ) external returns (uint amountETH) {
        address _WETH = WETH;
        address pair = SolarexSwapLibrary.pairFor(factory, token, _WETH);

        { // scope to avoid stack too deep errors
        uint value = approveMax ? uint(-1) : liquidity;
        ISolarexSwapPair(pair).permit(msg.sender, address(this), value, deadline, v, r, s);
        }

        amountETH = _removeLiquidityETHSupportingFeeOnTransferTokens(
            _WETH, pair, token, liquidity, amountTokenMin, amountETHMin, to
        );
    }
    function removeLiquidityETHWithPermitSupportingFeeOnTransferTokens2(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline,
        bool approveMax, bytes calldata signature
    ) external returns (uint amountETH) {
        address _WETH = WETH;
        address pair = SolarexSwapLibrary.pairFor(factory, token, _WETH);

        { // scope to avoid stack too deep errors
        uint value = approveMax ? uint(-1) : liquidity;
        ISolarexSwapPair(pair).permit2(msg.sender, address(this), value, deadline, signature);
        }

        amountETH = _removeLiquidityETHSupportingFeeOnTransferTokens(
            _WETH, pair, token, liquidity, amountTokenMin, amountETHMin, to
        );
    }

    // **** SWAP ****
    function _swapSimple(address pair, address tokenIn, address tokenOut, uint amountOut, address to) internal {
        if (tokenIn < tokenOut) { // whether input token is `token0`
            ISolarexSwapPair(pair).swapFor1(amountOut, to);
        } else {
            ISolarexSwapPair(pair).swapFor0(amountOut, to);
        }
    }

    // requires the initial amount to have already been sent to the first pair
    function _swap(
        address _factory,
        address pair,
        uint[] memory amounts,
        address[] memory path,
        address _to
    ) internal {
        uint end = path.length - 1;
        for (uint i; i < end; ++i) {
            (address input, address output) = (path[i], path[i + 1]);
            uint _amountOut = amounts[i + 1];

            if (i < end - 1) {
                address _pair = pair;
                pair = SolarexSwapLibrary.pairFor(_factory, output, path[i + 2]);
                _swapSimple(_pair, input, output, _amountOut, pair);
            } else {
                _swapSimple(pair, input, output, _amountOut, _to);
            }
        }
    }

    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external ensure(deadline) returns (uint[] memory amounts) {
        address _factory = factory;
        amounts = SolarexSwapLibrary.getAmountsOut(_factory, amountIn, path);
        require(amounts[amounts.length - 1] >= amountOutMin, 'O');

        address tokenIn = path[0];
        address initialPair = SolarexSwapLibrary.pairFor(_factory, tokenIn, path[1]);
        TransferHelper.safeTransferFrom(
            tokenIn, msg.sender, initialPair, amounts[0]
        );

        _swap(_factory, initialPair, amounts, path, to);
    }

    function swapTokensForExactTokens(
        uint amountOut,
        uint amountInMax,
        address[] calldata path,
        address to,
        uint deadline
    ) external ensure(deadline) returns (uint[] memory amounts) {
        address _factory = factory;
        amounts = SolarexSwapLibrary.getAmountsIn(_factory, amountOut, path);
        uint _amountIn = amounts[0];
        require(_amountIn <= amountInMax, 'E');

        address tokenIn = path[0];
        address initialPair = SolarexSwapLibrary.pairFor(_factory, tokenIn, path[1]);
        TransferHelper.safeTransferFrom(
            tokenIn, msg.sender, initialPair, _amountIn
        );

        _swap(_factory, initialPair, amounts, path, to);
    }

    function swapExactETHForTokens(uint amountOutMin, address[] calldata path, address to, uint deadline)
        external
        payable
        ensure(deadline)
        returns (uint[] memory amounts)
    {
        address tokenIn = path[0];
        address _WETH = WETH;
        require(tokenIn == _WETH, 'P');

        address _factory = factory;
        amounts = SolarexSwapLibrary.getAmountsOut(_factory, msg.value, path);
        require(amounts[amounts.length - 1] >= amountOutMin, 'O');

        uint _amountIn = amounts[0];
        IWETH(_WETH).deposit.value(_amountIn)();
        address initialPair = SolarexSwapLibrary.pairFor(_factory, tokenIn, path[1]);
        assert(IWETH(_WETH).transfer(initialPair, _amountIn));

        _swap(_factory, initialPair, amounts, path, to);
    }

    function swapTokensForExactETH(uint amountOut, uint amountInMax, address[] calldata path, address to, uint deadline)
        external
        ensure(deadline)
        returns (uint[] memory amounts)
    {
        address _WETH = WETH;
        require(path[path.length - 1] == _WETH, 'P');

        address _factory = factory;
        amounts = SolarexSwapLibrary.getAmountsIn(_factory, amountOut, path);
        uint _amountIn = amounts[0];
        require(_amountIn <= amountInMax, 'E');

        address tokenIn = path[0];
        address initialPair = SolarexSwapLibrary.pairFor(_factory, tokenIn, path[1]);
        TransferHelper.safeTransferFrom(
            tokenIn, msg.sender, initialPair, _amountIn
        );
        _swap(_factory, initialPair, amounts, path, address(this));

        uint _amountOut = amounts[amounts.length - 1];
        IWETH(_WETH).withdraw(_amountOut);
        TransferHelper.safeTransferETH(to, _amountOut);
    }

    function swapExactTokensForETH(uint amountIn, uint amountOutMin, address[] calldata path, address to, uint deadline)
        external
        ensure(deadline)
        returns (uint[] memory amounts)
    {
        address _WETH = WETH;
        require(path[path.length - 1] == _WETH, 'P');

        address _factory = factory;
        amounts = SolarexSwapLibrary.getAmountsOut(_factory, amountIn, path);
        uint _amountOut = amounts[amounts.length - 1];
        require(_amountOut >= amountOutMin, 'O');

        address tokenIn = path[0];
        address initialPair = SolarexSwapLibrary.pairFor(_factory, tokenIn, path[1]);
        TransferHelper.safeTransferFrom(
            tokenIn, msg.sender, initialPair, amounts[0]
        );
        _swap(_factory, initialPair, amounts, path, address(this));

        IWETH(_WETH).withdraw(_amountOut);
        TransferHelper.safeTransferETH(to, _amountOut);
    }

    function swapETHForExactTokens(uint amountOut, address[] calldata path, address to, uint deadline)
        external
        payable
        ensure(deadline)
        returns (uint[] memory amounts)
    {
        address tokenIn = path[0];
        address _WETH = WETH;
        require(tokenIn == _WETH, 'P');

        address _factory = factory;
        amounts = SolarexSwapLibrary.getAmountsIn(_factory, amountOut, path);
        uint _amountIn = amounts[0];
        require(_amountIn <= msg.value, 'E');

        IWETH(_WETH).deposit.value(_amountIn)();
        address initialPair = SolarexSwapLibrary.pairFor(_factory, tokenIn, path[1]);
        assert(IWETH(_WETH).transfer(initialPair, _amountIn));

        _swap(_factory, initialPair, amounts, path, to);

        // refund dust eth, if any
        if (msg.value > _amountIn) {
            TransferHelper.safeTransferETH(msg.sender, msg.value - _amountIn);
        }
    }

    // **** SWAP (supporting fee-on-transfer tokens) ****
    // requires the initial amount to have already been sent to the first pair
    function _swapSupportingFeeOnTransferTokens(
        address _factory,
        address pair,
        address[] memory path,
        address _to
    ) internal {
        for (uint i; i < path.length - 1; ++i) {
            (address input, address output) = (path[i], path[i + 1]);

            uint amountOutput;
            { // scope to avoid stack too deep errors
            (uint reserve0, uint reserve1) = ISolarexSwapPair(pair).getReservesSimple();
            (uint reserveInput, uint reserveOutput) = input < output ? (reserve0, reserve1) : (reserve1, reserve0);
            uint amountInput = IERC20(input).balanceOf(pair).sub(reserveInput);
            amountOutput = SolarexSwapLibrary.getAmountOut(amountInput, reserveInput, reserveOutput, ISolarexSwapPair(pair).getSwapFee());
            }

            if (i < path.length - 2) {
                address _pair = pair;
                pair = SolarexSwapLibrary.pairFor(_factory, output, path[i + 2]);
                _swapSimple(_pair, input, output, amountOutput, pair);
            } else {
                _swapSimple(pair, input, output, amountOutput, _to);
            }
        }
    }

    function swapExactTokensForTokensSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external ensure(deadline) {
        address tokenIn = path[0];
        address _factory = factory;
        address initialPair = SolarexSwapLibrary.pairFor(_factory, tokenIn, path[1]);
        TransferHelper.safeTransferFrom(
            tokenIn, msg.sender, initialPair, amountIn
        );

        address tokenOut = path[path.length - 1];
        uint balanceBefore = IERC20(tokenOut).balanceOf(to);
        _swapSupportingFeeOnTransferTokens(_factory, initialPair, path, to);

        require(
            IERC20(tokenOut).balanceOf(to).sub(balanceBefore) >= amountOutMin,
            'O'
        );
    }

    function swapExactETHForTokensSupportingFeeOnTransferTokens(
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    )
        external
        payable
        ensure(deadline)
    {
        address tokenIn = path[0];
        address _WETH = WETH;
        require(tokenIn == _WETH, 'P');

        uint amountIn = msg.value;
        IWETH(_WETH).deposit.value(amountIn)();
        address _factory = factory;
        address initialPair = SolarexSwapLibrary.pairFor(_factory, tokenIn, path[1]);
        assert(IWETH(_WETH).transfer(initialPair, amountIn));

        address tokenOut = path[path.length - 1];
        uint balanceBefore = IERC20(tokenOut).balanceOf(to);
        _swapSupportingFeeOnTransferTokens(_factory, initialPair, path, to);

        require(
            IERC20(tokenOut).balanceOf(to).sub(balanceBefore) >= amountOutMin,
            'O'
        );
    }

    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    )
        external
        ensure(deadline)
    {
        address _WETH = WETH;
        require(path[path.length - 1] == _WETH, 'P');

        address tokenIn = path[0];
        address _factory = factory;
        address initialPair = SolarexSwapLibrary.pairFor(_factory, tokenIn, path[1]);
        TransferHelper.safeTransferFrom(
            tokenIn, msg.sender, initialPair, amountIn
        );

        _swapSupportingFeeOnTransferTokens(_factory, initialPair, path, address(this));
        uint _amountOut = IERC20(_WETH).balanceOf(address(this));
        require(_amountOut >= amountOutMin, 'O');

        IWETH(_WETH).withdraw(_amountOut);
        TransferHelper.safeTransferETH(to, _amountOut);
    }

    // **** LIBRARY FUNCTIONS ****
    function quote(uint amountA, uint reserveA, uint reserveB) public pure returns (uint amountB) {
        return SolarexSwapLibrary.quote(amountA, reserveA, reserveB);
    }

    function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut, uint swapFee)
        public
        pure
        returns (uint amountOut)
    {
        return SolarexSwapLibrary.getAmountOut(amountIn, reserveIn, reserveOut, swapFee);
    }

    function getAmountIn(uint amountOut, uint reserveIn, uint reserveOut, uint swapFee)
        public
        pure
        returns (uint amountIn)
    {
        return SolarexSwapLibrary.getAmountIn(amountOut, reserveIn, reserveOut, swapFee);
    }

    function getAmountsOut(uint amountIn, address[] memory path)
        public
        view
        returns (uint[] memory amounts)
    {
        return SolarexSwapLibrary.getAmountsOut(factory, amountIn, path);
    }

    function getAmountsIn(uint amountOut, address[] memory path)
        public
        view
        returns (uint[] memory amounts)
    {
        return SolarexSwapLibrary.getAmountsIn(factory, amountOut, path);
    }
}

